import styles from "./index.module.scss";

export const FooterContacts = () => {
  return (
    <div className={styles.contacts}>
      <h4>Контакты</h4>
      <ul>
        <li>
          <a href="">Главная</a>
        </li>
        <li>
          <a href="">О нас</a>
        </li>
        <li>
          <a href="">Комнаты</a>
        </li>
        <li>
          <a href="">Новости</a>
        </li>
      </ul>
    </div>
  );
};
